import {
  Link,
  Route,
  BrowserRouter as Router,
  Switch
} from "react-router-dom";
import React, { Component } from "react"

import Clock from "./Clock"
import Radio from "./Radio"

// const navStyle = {
//   color: "red",
//   backgroundcolor: "black",
// }

class NavBar extends Component {
  render() {
    return (
      <Router>
      <div>
        <nav>
        <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
          {/* <a className="navbar-brand" href="/#Clock">
            Clock
          </a>
          <a className="navbar-brand" href="/#Radio">
            Radio
          </a> */}
        </nav>

          <Switch>
          <Route path="/">
            <Clock/>
          </Route>
          <Route path="/radio">
            <Radio/>
          </Route>

        </Switch>
      </div>
      </Router>
    )
  }
}

export default NavBar
